class Weapon
{
public:
    GLint name;
    bool attack;
    GLfloat damage;
    GLfloat range;
    GLint ammo;
    GLint cooldown;

    Weapon() {}
    Weapon(GLint name, GLfloat damage, GLfloat range, GLfloat ammo)
    {
        this->name = name;
        this->attack = false;
        this->damage = damage;
        this->range = range;
        this->ammo = ammo;
        this->cooldown = 0;
    }

    void show(GLfloat bounds, GLfloat height);
};

void Weapon::show(GLfloat bounds, GLfloat height)
{
    if(cooldown > 0)
    {
        cooldown--;
        attack = false;
    }

    if (name == 0)
    {
        if (attack && cooldown <= 0)
        {
            glBegin(GL_QUADS);
            glColor3f(0.8, 0.8, 0.8);
            glVertex2f(1.5 * bounds, bounds / 2);
            glVertex2f(1.5 * bounds + 30, bounds / 2 - 20);
            glVertex2f(1.7 * bounds, bounds / 2 - height / 2);
            glVertex2f(1.64 * bounds, bounds / 2 - height / 2);
            glColor3f(0.6, 0.6, 0.6);
            glVertex2f(1.5 * bounds, bounds / 2 - 50);
            glVertex2f(1.5 * bounds, bounds / 2);
            glVertex2f(1.64 * bounds, bounds / 2 - height / 2);
            glVertex2f(1.6 * bounds, bounds / 2 - height / 2);
            glEnd();
            attack = false;
        }
        else
        {
            glBegin(GL_QUADS);
            glColor3f(0.8, 0.8, 0.8);
            glVertex2f(1.6 * bounds, bounds / 2);
            glVertex2f(1.6 * bounds + 30, bounds / 2 - 20);
            glVertex2f(1.8 * bounds, bounds / 2 - height / 2);
            glVertex2f(1.74 * bounds, bounds / 2 - height / 2);
            glColor3f(0.6, 0.6, 0.6);
            glVertex2f(1.6 * bounds, bounds / 2 - 50);
            glVertex2f(1.6 * bounds, bounds / 2);
            glVertex2f(1.74 * bounds, bounds / 2 - height / 2);
            glVertex2f(1.7 * bounds, bounds / 2 - height / 2);
            glEnd();
        }
    }
    else if (name == 1)
    {
        if (attack && ammo && cooldown <= 0)
        {
            ammo--;
            cooldown = 5;
            attack = false;
        }
        drawSprite(1.6 * bounds, bounds / 2 - height / 2, 128, 128, pistol_textures[cooldown]);
    }
    else if(name == 2)
    {
        if (attack && ammo && cooldown <= 0)
        {
            drawSprite(1.6 * bounds, bounds / 2 - height / 2, 256, 256, shotgunfire_texture);
            ammo--;
            cooldown = 100;
            attack = false;
        }
        else
        {
            drawSprite(1.6 * bounds, bounds / 2 - height / 2, 256, 256, shotgun_texture);
        }
    }
}

// Map
class Map
{
public:
    GLint blockSize;
    vector<vector<GLint>> walls;
    vector<GLint> shape;
    vector<GLfloat> pos;
    Map(vector<GLfloat> pos, vector<vector<GLint>> walls, GLint blockSize)
    {
        this->pos = pos;
        this->blockSize = blockSize;
        this->walls = walls;
        this->shape = vector<GLint>{walls.size(), walls[0].size()};
    }
    void show();
};

void Map::show()
{
    for (int i = shape[0] - 1; i >= 0; i--)
    {
        for (int j = 0; j < shape[1]; j++)
        {
            if (walls[i][j] == 0)
            {
                glColor3f(0.1, 0.1, 0.1);
            }
            else if (walls[i][j] == 1)
            {
                glColor3f(1, 1, 1);
            }
            glBegin(GL_QUADS);
            glVertex2f(pos[0] + i * blockSize + 1, pos[1] + j * blockSize + 1);
            glVertex2f(pos[0] + (i + 1) * blockSize - 1, pos[1] + j * blockSize + 1);
            glVertex2f(pos[0] + (i + 1) * blockSize - 1, pos[1] + (j + 1) * blockSize - 1);
            glVertex2f(pos[0] + i * blockSize + 1, pos[1] + (j + 1) * blockSize - 1);
            glEnd();
        }
    }
}

